import React from 'react'
import '../assets/css/Error.css'
import Img12345 from '../assets/img/Grupo_12345.png'

function Error() {
  return (
    <div className='ErrorCon'>
        <button>
            <img src={Img12345} alt="" />
        </button>
    </div>
  )
}

export default Error
